import React from 'react';
import TextField from '@material-ui/core/TextField';

import './Login.scss';

function Login() {
  return (
    <div>
      <h2>Login</h2>
      <TextField
        id="login-email"
        label="Email"
      />
      <TextField
        id="login-password"
        label="Password"
        type="password"
        autoComplete="current-password"
        margin="normal"
      />

    </div>
  );
}

export default Login;
